import React from 'react';

    function createPattern() {
        return {
            __html: `                  
            <span>This is full text</span>
           `};
      }
      
    function ArticleText() {
    
            return (<div className="article-text" dangerouslySetInnerHTML={createPattern()} />)      
                    ;
      }

export const ArticleFullText = () => {
    return ArticleText()
}
